import React from 'react';
import { Button } from "./ui/button";
import { Input } from "./ui/input";
import { Textarea } from "./ui/textarea";
import { useToast } from "../hooks/use-toast.js";
import { MapPin, Phone, Mail, Clock, Facebook, Instagram, Linkedin, Youtube, Twitter } from "lucide-react";

export interface ContactPageProps {
  title?: string;
  subtitle?: string;
  contactInfo?: {
    address: string;
    phone: string;
    email: string;
    workingHours: {
      weekdays: string;
      saturday: string;
    };
  };
}

export const ContactPageComplete: React.FC<ContactPageProps> = ({
  title = "Contact Us",
  subtitle = "Have questions or want to get involved? Reach out to us today.",
  contactInfo = {
    address: "123 NGO Street, Bengaluru, Karnataka, India",
    phone: "+91 98765 43210",
    email: "info@yourorga.org",
    workingHours: {
      weekdays: "Monday - Friday: 9AM - 5PM",
      saturday: "Saturday: 10AM - 2PM"
    }
  }
}) => {
  const { toast } = useToast();
  const [formData, setFormData] = React.useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    
    // Basic validation
    if (!formData.name || !formData.email || !formData.message) {
      toast({
        title: "Error",
        description: "Please fill in all required fields",
        variant: "destructive",
      });
      return;
    }

    // Here you would typically send the form data to your backend
    console.log("Form submitted:", formData);
    
    toast({
      title: "Message Sent",
      description: "Thank you for your message. We'll get back to you soon!",
    });

    // Reset form
    setFormData({
      name: '',
      email: '',
      subject: '',
      message: ''
    });
  };

  return (
    <div className="container mx-auto py-12 px-4">
      <div className="text-center mb-12">
        <h1 className="text-3xl font-bold text-blue-800 mb-4">{title}</h1>
        <p className="text-gray-600 max-w-2xl mx-auto">
          {subtitle}
        </p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        <div>
          <div className="bg-sky-50 p-6 rounded-lg shadow-sm">
            <h2 className="text-xl font-semibold mb-4 text-blue-800">Send Us a Message</h2>
            <form onSubmit={handleSubmit}>
              <div className="space-y-4">
                <div>
                  <label htmlFor="name" className="block text-sm font-medium text-blue-700 mb-1">
                    Name
                  </label>
                  <Input
                    id="name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    placeholder="Your Name"
                    required
                  />
                </div>

                <div>
                  <label htmlFor="email" className="block text-sm font-medium text-blue-700 mb-1">
                    Email
                  </label>
                  <Input
                    id="email"
                    name="email"
                    type="email"
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Your Email"
                    required
                  />
                </div>

                <div>
                  <label htmlFor="subject" className="block text-sm font-medium text-blue-700 mb-1">
                    Subject
                  </label>
                  <Input
                    id="subject"
                    name="subject"
                    value={formData.subject}
                    onChange={handleChange}
                    placeholder="Subject"
                  />
                </div>

                <div>
                  <label htmlFor="message" className="block text-sm font-medium text-blue-700 mb-1">
                    Message
                  </label>
                  <Textarea
                    id="message"
                    name="message"
                    value={formData.message}
                    onChange={handleChange}
                    placeholder="Your Message"
                    className="min-h-[120px]"
                    required
                  />
                </div>

                <Button 
                  type="submit" 
                  className="w-full bg-blue-700 hover:bg-blue-800 text-white"
                >
                  Send Message
                </Button>
              </div>
            </form>
          </div>
        </div>
        <div>
          <div className="space-y-8">
            <div>
              <h2 className="text-xl font-semibold mb-4 text-blue-800">Contact Information</h2>
              <div className="space-y-4">
                <div className="flex items-start">
                  <MapPin className="w-5 h-5 text-blue-600 mt-1 mr-2" />
                  <div>
                    <h3 className="font-medium text-blue-700">Address</h3>
                    <p className="text-gray-700">{contactInfo.address}</p>
                  </div>
                </div>
                
                <div className="flex items-start">
                  <Phone className="w-5 h-5 text-blue-600 mt-1 mr-2" />
                  <div>
                    <h3 className="font-medium text-blue-700">Phone</h3>
                    <p className="text-gray-700">{contactInfo.phone}</p>
                  </div>
                </div>
                
                <div className="flex items-start">
                  <Mail className="w-5 h-5 text-blue-600 mt-1 mr-2" />
                  <div>
                    <h3 className="font-medium text-blue-700">Email</h3>
                    <p className="text-gray-700">{contactInfo.email}</p>
                  </div>
                </div>
                
                <div className="flex items-start">
                  <Clock className="w-5 h-5 text-blue-600 mt-1 mr-2" />
                  <div>
                    <h3 className="font-medium text-blue-700">Working Hours</h3>
                    <p className="text-gray-700">{contactInfo.workingHours.weekdays}</p>
                    <p className="text-gray-700">{contactInfo.workingHours.saturday}</p>
                  </div>
                </div>
              </div>
            </div>
            
            <div>
              <h2 className="text-xl font-semibold mb-4 text-blue-800">Connect With Us</h2>
              <div className="flex space-x-3">
